description:
THE ALEX JONES SHOW
2009.04.24 Friday

Alex talks with Texas Rep. Ron Paul in first hour and regular guest Bob Chapman of the International Forecaster in the second and third hours. Alex runs down the important issues of the day and takes your calls.

HR 1: Show overview, news stack- flu, police, banks, realID, etc., RON PAUL
HR 2: Recap on Pakistan, BOB CHAPMAN, open lines w/Chapman
HR 3: More Chapman, Ted Anderson jumps in, open lines
HR 4: Open lines, rapid news blitz

   &quot;A country boy will survive...&quot;

